            <h3>cup: {ing.cup}</h3>
            <h3>mL: {ing.ml}</h3>
            <h3>L: {ing.L}</h3>
            </p>
            </CardContent>
            </Card>
        ))
            
        return (
            
 <p>{data2}</p>

    
        )
}
}

export default SumIngredients;
